import React from 'react';
import './MyProfile.css';

const MyProfile = ({ level, point }) => {
    return (
        <div className='profile'>
            <img src="img/Profile.png"></img>
            <div>{level}</div>
            <div className='point'>{point}</div>
        </div>
    );
};

export default MyProfile;
